#include <./stdc++11.h>

using namespace std;

bool findChange(map<int, int> & changeCounter, int payment) {
    changeCounter[payment]++;

    if (payment == 5) {
        return true;
    } else if (payment == 10) {
        return changeCounter[5]-- > 0;
    } else {
        if (changeCounter[5] >= 1 && changeCounter[10] >= 1) {
            changeCounter[5]--;
            changeCounter[10]--;
            return true;
        } else if (changeCounter[5] >= 3) {
            changeCounter[5] -= 3;
            return true;
        } else {
            return false;
        }
    }

    return false;
}

bool lemonadeChange(vector<int>& bills) {
    map<int, int> changeCounter;

    for (auto customer : bills) {
        if (!findChange(changeCounter, customer)) {
            return false;
        }
    }

    return true;   
}

